Sky Island

Nature Documentary hosted by Navarre Scott Momaday, published by PBS in 2011 - English narration


Information
------------------------------

In northern New Mexico, a mountain range rises more than a mile above the surrounding desert, a wild, rugged land of the Faraway Nearby. The volcanic Jemez Mountains are isolated from all other ranges - an island in the sky, surrounded by a desert sea. 
In Sky Island, environmental filmmaker John Grabowska (Ribbon of Sand, Crown of the Continent) profiles this enchanting landscape and our place within it, with dramatic climate change effects already transforming the desert and alpine ecosystem.

